    let floorTexture = new THREE.TextureLoader().load( './checkerboard.jpg' );
	floorTexture.wrapS = floorTexture.wrapT = THREE.RepeatWrapping; 
	floorTexture.repeat.set( 2.5, 2.5 );
	let floorMaterial = new THREE.MeshBasicMaterial( { map: floorTexture, side: THREE.DoubleSide } );

    floorMaterial.opacity = .5;
    floorMaterial.transparent = true;
    floorMaterial.needsUpdate = true;

	let floorGeometry = new THREE.PlaneBufferGeometry(20, 20, 10, 10);
	let floor = new THREE.Mesh(floorGeometry, floorMaterial);
	floor.rotation.x = Math.PI / 2;
	app.scene.add(floor);

let hitbox_name = VARS['hitbox_name'];
let hitbox_Obj = app.scene.getObjectByName(hitbox_name);
hitbox_Obj.material.opacity = 0;
hitbox_Obj.material.transparent = true;
hitbox_Obj.material.needsUpdate = true;
// console.log('hitbox_Obj.material:',hitbox_Obj.material);

let selectedItem = VARS['selected_item'];
let command = `v3d.puzzles.procedures.${selectedItem}()`;
eval(command);
